    [],nt"revision_timestamp": "2016-05-27T02:32:33.413970",nt"name": "broadband-radio-service-brs-and-educational-broadband-service-ebs-transmitters",nt"isopen":
    false,nt"url": null,nt"notes": "The Broadband Radio Service (BRS), formerly
    known as the Multipoint Distribution Service (MDS)/Multichannel Multipoint Distribution
    Service (MMDS), is a commercial service. In the past, it was generally used for
    the transmission of data and video programming to subscribers using high-powered
    systems, also known as wireless cable. However, over the years, the uses have evolved
    to include digital two-way systems capable of providing high-speed, high-capacity
    broadband service, including two-way Internet service via cellularized communication
    systems. Such services provide consumers integrated access to voice, high-speed
    data, video-on-demand, and interactive delivery services from a wireless device.
    The Educational Broadband Service (EBS), formerly known as the Instructional Television
    Fixed Service (ITFS), is an educational service that has generally been used for
    the transmission of instructional material to accredited educational institutions
    and non-educational institutions such as hospitals, nursing homes, training centers,
    and rehabilitation centers using high-powered systems. Our recent revamping of the
    EBS spectrum will now make it possible for EBS users to continue their instructional
    services utilizing low-power broadband systems while also providing students with
    high-speed internet access.",nt"license_title": "License Not Specified",nt"extras":
